import Prices from "../../components/Prices";

export function Home() {
  return (
    <Box
      p={"25px 25px"}
      fontFamily={"Inter"}
      fontWeight={"400"}
      fontSize={"18px"}
      layerStyle={"fonts.body"}

    >
      <HeroBanner />
      <About />
      <Advantages />
      <Feedbacks />
      <Prices />
    </Box>
  );
}
